import vTable from "@c/tables/table";
import DataApi from "../webapi/DataApi";
import moment from "moment";
import config from "@/config/index";
export default {
  data() {
    var _ = this;
    return {
      isEdit: false,
      formData: {
        No: "", //编号
        Name: "", //名称
        Code: "", //编码
        MnenonicCode: "" //助记码
      },
      tableOption: {
        url: config.pgyerApiUrl + DataApi.GetSendUnitLevelList.options.url,
        method: DataApi.GetSendUnitLevelList.options.method,
        columns: [
          { field: "id", title: "编号", align: "center" },
          { field: "name", title: "名称", align: "center" },
          {
            field: "test",
            title: "操作",
            align: "center",
            sortable: true,
            formatter: function(val, row) {
              return (
                '<div clss="btn-group">' +
                '<a class="btn btn-info btn-sm"  iid="' +
                val +
                '">详情</a>' +
                "</div>"
              );
            }
          }
        ]
      },
      detailtableOption: {
        url: config.pgyerApiUrl + DataApi.GetSendOutWareHoustList.options.url,
        method: DataApi.GetSendOutWareHoustList.options.method,
        columns: [
          { field: "id", title: "编号", align: "center" },
          { field: "name", title: "名称", align: "center" }
        ]
      }
    };
  },
  watch: {
    isEdit: {
      handler: function(curVal, oldVal) {
        if (curVal) {
          var _ = this;
          setTimeout(function() {
            _.initValidate();
          }, 100);
        }
      }
    }
  },
  mounted: function() {
    var _ = this;
    _.$refs.table.tableObj.on("click", "a", function() {
      _.editModel();
    });
  },
  methods: {
    search: function(params) {
      this.$refs.table.tableOption.params = params;
      this.$refs.table.operation("refresh");
    },
    initValidate: function() {
      
    },
    editModel: function() {
      var _ = this;
      _.isEdit = true;
      setTimeout(function() {
        _.layerId = layer.open({
          type: 1,
          title: "详情",
          maxmin: false,
          area: ["70%", "70%"],
          content: $("#edit"),
          end: function() {
            _.isEdit = false;
          }
        });
      }, 50);
    }
  },
  components: { vTable }
};
